import {connect} from 'react-redux'
import Post from '../components/Post'

const mapStateToProps = (state, ownProps) => ({
    title: ownProps.title,
    text: ownProps.text,
    id: ownProps.id
});

export default connect(
    mapStateToProps,
)(Post)
